import React from "react";
import ReactDOM from "react-dom";
function BookList(){
    return (
        <section>
            <Author/>
            <Book/>
        </section>
    );
}

const Book=() => {
    return (
        <div>
            <Image/>
        </div>
    )
}

const Image = () =>{
    return(
        <img src="https://upload.wikimedia.org/wikipedia/en/thumb/9/9a/Trollface_non-free.png/330px-Trollface_non-free.png"></img>
    )
}

const Title = () =>{
    return(
        <h1>I am big author</h1>
    )
}
ReactDOM.render(<BookList/>,document.getElementById('root'));
